void init()
{
    int lim=sqrt(MAX)+1;
    int j;
    set(0);
    for(int i=3;i<=lim;i+=2)
    {
        if(!isNotPrime(i/2))
        {
            for(j=i*i;j<=MAX;j+=2*i)
                set(j/2);          
        }   
    }
}
void solve()
{
    //tinh so nguyen to nho hon n.
    int pi=store[n/d];
    int start=(int)(n/d)*d +1;
    REP(i,start,n)
    {
        pi+=isPrime(i);
    }
    double result;
    result=fabs(1.0-(double)n/(log(n*1.0)*pi));
    result*=100.0;
    printf("%.1f\n",result);
    
}
